import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonCheckbox, IonList,
    IonItem, IonLabel, IonCard, IonCardContent, IonButtons }
    from '@ionic/react';
import React from 'react';
import { RouteComponentProps } from 'react-router';

const SetProfile: React.FC<RouteComponentProps> = ({history, location}) => {
  <IonPage>
    <IonHeader>
      <IonToolbar>
        <IonTitle>Survey</IonTitle>
      </IonToolbar>
    </IonHeader>
  </IonPage>
};

export default SetProfile;
